import React from 'react';

type SuperCounterType = {
    inc: () => void
    value: number
    reset: () => void

}


export const SuperCounter = (props: SuperCounterType) => {


    const Inc = () => {
        props.inc()
    }

    const Reset = () => {
        props.reset()
    }
    return (
        <div>
            <div>{props.value}</div>
            <button onClick={Inc} disabled={props.value >= 5}>inc</button>
            <button onClick={Reset}>reset</button>
        </div>
    );
};
